import React, { useState}  from 'react'
import { Link } from 'react-router-dom'
// import { useForm } from "react-hook-form";
import House from '../assets/images/house_PNG.png'


export default function home() {
    // const [city, setCity] = useState('');
    // const onSubmit = (data) => {
    //     return <Redirect to="/home" />
    // }


    return (
        <div className="container home">
             {/** main image */}
            <div className="main-image-container"> 
                <img alt="Houses Searching" src={House} />
            </div>

            {/** main content */}
            <div className="main-text-container">
                <div>
                <h1>Find Your New Place with <span>HouseFinder!</span></h1>
                    <p>
                        Knowing the neighbor, you can look for the ideal house 
                        available across the country.  </p>
                </div>
                 {/** search bar */}
                <div className="search-container">
                    {/* <form onSubmit={onSubmit}> */}
                    <form>
                        <input type="text" placeholder="Search.." name="search" />
                            {/* <button type="submit"><i className="ionicons icon ion-ios-search"/></button> */}
                            <input
                className="mt-4 sm:mt-0 bg-themeYellow mx-1 px-3 py-1 lg:ml-6 lg:text-2xl rounded-lg text-xl text-gray-800 focus:outline-none focus:shadow-outline shadow"
                type="submit"
                value="Search"/>
                            <Link to="/Listing"><i className="ionicons icon ion-ios-search"/> </Link>
                    </form>
                </div>
                <div>
                    <Link to="/Listing"> All Houses </Link>
                </div>
            </div>

        </div>
    )
}
